import React, {Component} from 'react';

class NavBar extends Component{
    render(){
        return (
            <React.Fragment>
              <nav className="navbar">
                  <h1><span className="badge">This is some text</span></h1>
              </nav>
            </React.Fragment>
          );
    }

}

export default NavBar;
